import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { useUserData } from '../context/UserDataContext';
import { validateUserData, sanitizeInput } from '../utils/validation';

const UserIntakeForm = () => {
  const navigate = useNavigate();
  const { state, dispatch } = useUserData();
  const [formData, setFormData] = useState({
    symptoms: state.userData.symptoms || '',
    location: state.userData.location || '',
    insurance: state.userData.insurance || ''
  });
  const [errors, setErrors] = useState({});

  const insuranceOptions = [
    { value: '', label: 'Select your insurance provider' },
    { value: 'Aetna', label: 'Aetna' },
    { value: 'Blue Cross', label: 'Blue Cross' },
    { value: 'Cigna', label: 'Cigna' },
    { value: 'UnitedHealth', label: 'UnitedHealth' }
  ];

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    const sanitizedValue = sanitizeInput(value);
    
    setFormData(prev => ({
      ...prev,
      [name]: sanitizedValue
    }));
    
    // Clear error when user starts typing
    if (errors[name]) {
      setErrors(prev => ({
        ...prev,
        [name]: ''
      }));
    }
  };

  const validateForm = () => {
    const validation = validateUserData(formData);
    setErrors(validation.errors);
    return validation.isValid;
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    
    if (validateForm()) {
      dispatch({
        type: 'SET_USER_DATA',
        payload: formData
      });
      navigate('/results');
    }
  };

  return (
    <div className="container">
      <div className="card">
        <h1 style={{ marginBottom: '30px', color: '#333' }}>Tell Us About Your Health Needs</h1>
        
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label htmlFor="symptoms">What symptoms are you experiencing?</label>
            <textarea
              id="symptoms"
              name="symptoms"
              value={formData.symptoms}
              onChange={handleInputChange}
              placeholder="Describe your symptoms in detail (e.g., skin rash, chest pain, headache)"
              rows="4"
              className={errors.symptoms ? 'error' : ''}
            />
            {errors.symptoms && <div className="error" style={{ marginTop: '8px' }}>{errors.symptoms}</div>}
          </div>

          <div className="form-group">
            <label htmlFor="location">Where are you located?</label>
            <input
              type="text"
              id="location"
              name="location"
              value={formData.location}
              onChange={handleInputChange}
              placeholder="Enter your city or zip code"
              className={errors.location ? 'error' : ''}
            />
            {errors.location && <div className="error" style={{ marginTop: '8px' }}>{errors.location}</div>}
          </div>

          <div className="form-group">
            <label htmlFor="insurance">What's your insurance provider?</label>
            <select
              id="insurance"
              name="insurance"
              value={formData.insurance}
              onChange={handleInputChange}
              className={errors.insurance ? 'error' : ''}
            >
              {insuranceOptions.map(option => (
                <option key={option.value} value={option.value}>
                  {option.label}
                </option>
              ))}
            </select>
            {errors.insurance && <div className="error" style={{ marginTop: '8px' }}>{errors.insurance}</div>}
          </div>

          <div style={{ display: 'flex', gap: '16px', marginTop: '30px' }}>
            <button
              type="button"
              className="btn btn-secondary"
              onClick={() => navigate('/')}
            >
              Back
            </button>
            <button
              type="submit"
              className="btn btn-primary"
              style={{ flex: '1' }}
            >
              Find Providers
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default UserIntakeForm;
